import * as React from 'react';

import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import FilterListIcon from '@mui/icons-material/FilterList';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
export default function CategoryTabs() {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
 
            <Tabs centered value={value} onChange={handleChange}      scrollButtons="auto" allowScrollButtonsMobile  sx={{paddingBottom:'10px'}}>
                <Tab label={<div>Giyim<span></span></div>} sx={{fontSize:'12px'}}/>
                <Tab label={<div><span>AyakkabÄ±</span></div>} sx={{fontSize:'12px'}} />
                <Tab label={<div><span>Aksessuar</span><br/><span style={{color:'#9e9e9e'}}>(1)</span></div>}   sx={{fontSize:'12px'}}/>
              
            </Tabs>
     

 
    );
}

function TabPanel(props) {
    const { children, value, index, ...other } = props;
  
    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box sx={{ p: 3 }}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }
